import React from "react";
import bg from '../../assets/bg_.jpg'
import { useTranslation } from 'react-i18next'


const LineFirst = () => {
    const { t } = useTranslation();
    return(
        <div style={{
            backgroundImage: `url(${bg})`,
            backgroundSize: '100% 100%',
            backgroundRepeat: 'no-repeat'
            }} className='line_list'>
            <div className='container'>
                <div style={{maxWidth: 1000}}>
                <p className='line_list_title_last text-white'><b>BitQuant</b> uses more than <b>100,000</b> users from all over the world.<br/> Why don't you give it a try right now?</p>
                <p style={{maxWidth: 630}} className='line_list_desc_last text-white mb-0'>{t('lineFirst')}</p>
                <button style={{width:282}} className='text-white'>{t('lineRirstButt')}</button>
                </div>
            </div>
        </div>
    )
}

export default LineFirst
